import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';
import TodoList from './components/TodoList';

const Router = () => {
	return (
		<BrowserRouter>
			<Route path='/' element={<TodoList />} />
		</BrowserRouter>
	);
};

export default Router;
